import React from "react";
import { Bar } from "react-chartjs-2";

const TestA = (props) => {
  const entries = props.filteredEntries;

  const timeNumberfied = entries.map((entry) =>
    parseFloat(
      `${entry.time.split(":")[0]}.${
        (entry.time.split(":")[1] / 60).toString().split(".")[1]
      }`.slice(0, 5)
    )
  );

  const xData = timeNumberfied;
  const yData = entries.map((entry) => entry.attendee_count);
  const combined = [];
  for (let i = 0; i < entries.length; i++) {
    const x = xData[i];
    const y = yData[i];
    const both = { x: x, y: y };
    combined.push(both);
  }

  const spacers = [];
  for (let i = 0; i < entries.length; i++) {
    const x = xData[i];
    const y = 0;
    const both = { x: x, y: y };
    spacers.push(both);
  }

  // console.log("combined", combined);
  // console.log("spacers", spacers)

  const timeSpaced = [];
  for (let j = 0; j < 24; j++) {
    for (let i = 0; i < 60; i++) {
      if (i % 60 != 0) {
        timeSpaced.push(
          parseFloat(`${j}.${(i / 60).toString().split(".")[1]}`)
        );
      } else {
        timeSpaced.push(parseFloat(`${j}.${i / 60}`));
      }
    }
  }
  console.log(timeSpaced);

  function barValue(x) {
    for (let barValue of combined) {
      if (Math.floor(x) == barValue.x) {
        return barValue.y;
      }
    }
    return 0;
  }
  // console.log(combined.map((v) => (v.x)), combined.map((v) => barValue(v.x)));

  return (
    <div>
      <Bar
        type="bar"
        data={{
          labels: timeSpaced.map((v) => v.x),
          datasets: [
            {
              backgroundColor: "#000",
              borderWidth: 2,
              fill: false,
              data: combined.map((v) => barValue(v.x)),
              // data: lineValues.map(v => barValue(v.x)),
              yAxisID: "A",
            },
          ],
        }}
        options={{
          responsive: true,
          legend: {
            display: false,
          },
          scales: {
            xAxes: [
              {
                display: true,
                ticks: {
                  maxTicksLimit: 10,
                  callback: (value) => Math.floor(value),
                },
              },
            ],
            yAxes: [
              {
                id: "A",
                display: true,
                type: "linear",
              },
            ],
          },
        }}
      />
    </div>
  );
};

export default TestA;
